(81, 1, '2020-09-04 14:16:02', '2020-09-04 14:16:02', '<h1>Id enim volumus, id contendimus, ut officii fructus sit ipsum officium.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliter enim explicari, quod quaeritur, non potest. Estne, quaeso, inquam, sitienti in bibendo voluptas? Quae quo sunt excelsiores, eo dant clariora indicia naturae. Et summatim quidem haec erant de corpore animoque dicenda, quibus quasi informatum est quid hominis natura postulet. Duo Reges: constructio interrete. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. Obsecro, inquit, Torquate, haec dicit Epicurus? Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Duarum enim vitarum nobis erunt instituta capienda. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Que Manilium, ab iisque M. </p>\n\n<p>Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Summum a vobis bonum voluptas dicitur. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. <i>Haec igitur Epicuri non probo, inquam.</i> Tanta vis admonitionis inest in locis; Quid igitur, inquit, eos responsuros putas? Quod cum dixissent, ille contra. Atqui perspicuum est hominem e corpore animoque constare, cum primae sint animi partes, secundae corporis. </p>\n\n<h3>Si longus, levis.</h3>\n\n<p>Tecum optime, deinde etiam cum mediocri amico. Fortitudinis quaedam praecepta sunt ac paene leges, quae effeminari virum vetant in dolore. Quid censes in Latino fore? Quod quidem iam fit etiam in Academia. Ut proverbia non nulla veriora sint quam vestra dogmata. </p>\n\n<h4>Facillimum id quidem est, inquam.</h4>\n\n<p>Quamquam non negatis nos intellegere quid sit voluptas, sed quid ille dicat. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Hoc dictum in una re latissime patet, ut in omnibus factis re, non teste moveamur. </p>\n\n<p><b>Tamen a proposito, inquam, aberramus.</b> Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Collatio igitur ista te nihil iuvat. Neminem videbis ita laudatum, ut artifex callidus comparandarum voluptatum diceretur. Suam denique cuique naturam esse ad vivendum ducem. Frater et T. </p>\n\n<h2>Cur haec eadem Democritus?</h2>\n\n<p>Quid de Platone aut de Democrito loquar? Quis, quaeso, illum negat et bonum virum et comem et humanum fuisse? Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Quod equidem non reprehendo; An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Non enim ipsa genuit hominem, sed accepit a natura inchoatum. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; <b>Dicimus aliquem hilare vivere;</b> </p>\n\n<p><b>Efficiens dici potest.</b> Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. At enim, qua in vita est aliquid mali, ea beata esse non potest. </p>\n\n', 'Id enim volumus, id contendimu', ' Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliter enim explicari, quod quaeritur, non.', 'publish', 'open', 'open', '', 'id-enim-volumus-id-contendimu', '', '', '2020-09-04 14:16:02', '2020-09-04 14:16:02', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/id-enim-volumus-id-contendimu/', 0, 'post', '', 0),
