(83, 1, '2020-09-04 14:16:21', '2020-09-04 14:16:21', '<h1>Quod autem ratione actum est, id officium appellamus.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; Si quicquam extra virtutem habeatur in bonis. <i>Contineo me ab exemplis.</i> Duo Reges: constructio interrete. Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? Illud dico, ea, quae dicat, praeclare inter se cohaerere. Quamquam tu hanc copiosiorem etiam soles dicere. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Istam voluptatem perpetuam quis potest praestare sapienti? Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. </p>\n\n<p>Quia voluptatem hanc esse sentiunt omnes, quam sensus accipiens movetur et iucunditate quadam perfunditur. Universa enim illorum ratione cum tota vestra confligendum puto. Nunc omni virtuti vitium contrario nomine opponitur. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Nunc agendum est subtilius. Hanc ergo intuens debet institutum illud quasi signum absolvere. Nec vero intermittunt aut admirationem earum rerum, quae sunt ab antiquis repertae, aut investigationem novarum. <i>Sed residamus, inquit, si placet.</i> Hoc loco discipulos quaerere videtur, ut, qui asoti esse velint, philosophi ante fiant. Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? </p>\n\n<p>Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Quae si potest singula consolando levare, universa quo modo sustinebit? Ut enim consuetudo loquitur, id solum dicitur honestum, quod est populari fama gloriosum. Vitiosum est enim in dividendo partem in genere numerare. Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. <b>Ergo, inquit, tibi Q.</b> <b>Res enim concurrent contrariae.</b> Simul atque natum animal est, gaudet voluptate et eam appetit ut bonum, aspernatur dolorem ut malum. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Quare attende, quaeso. Nisi autem rerum natura perspecta erit, nullo modo poterimus sensuum iudicia defendere. </p>\n\n<p>Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Sin laboramus, quis est, qui alienae modum statuat industriae? Compensabatur, inquit, cum summis doloribus laetitia. Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. Facit igitur Lucius noster prudenter, qui audire de summo bono potissimum velit; Idemque diviserunt naturam hominis in animum et corpus. Et ais, si una littera commota sit, fore tota ut labet disciplina. </p>\n\n<h2>Quid turpius quam sapientis vitam ex insipientium sermone pendere?</h2>\n\n<p><i>Utrum igitur tibi litteram videor an totas paginas commovere?</i> Uterque enim summo bono fruitur, id est voluptate. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Etsi ea quidem, quae adhuc dixisti, quamvis ad aetatem recte isto modo dicerentur. <i>Eaedem res maneant alio modo.</i> Cur igitur, inquam, res tam dissimiles eodem nomine appellas? <i>Si enim ad populum me vocas, eum.</i> <i>Sic enim censent, oportunitatis esse beate vivere.</i> Et si turpitudinem fugimus in statu et motu corporis, quid est cur pulchritudinem non sequamur? <i>Ita prorsus, inquam;</i> <b>Hoc simile tandem est?</b> Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. </p>\n\n<p>Ne in odium veniam, si amicum destitero tueri. Omnes enim iucundum motum, quo sensus hilaretur. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Quia dolori non voluptas contraria est, sed doloris privatio. Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Quare attende, quaeso. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? In eo enim positum est id, quod dicimus esse expetendum. </p>\n\n<h3>Praeteritis, inquit, gaudeo.</h3>\n\n<p>Tu enim ista lenius, hic Stoicorum more nos vexat. Miserum hominem! Si dolor summum malum est, dici aliter non potest. Is ita vivebat, ut nulla tam exquisita posset inveniri voluptas, qua non abundaret. Non potes, nisi retexueris illa. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Restant Stoici, qui cum a Peripateticis et Academicis omnia transtulissent, nominibus aliis easdem res secuti sunt. </p>\n\n<p><b>Non quam nostram quidem, inquit Pomponius iocans;</b> Nonne igitur tibi videntur, inquit, mala? Duo enim genera quae erant, fecit tria. Eadem nunc mea adversum te oratio est. At multis malis affectus. Haec et tu ita posuisti, et verba vestra sunt. </p>\n\n<p><i>Quod quidem nobis non saepe contingit.</i> Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Quid ait Aristoteles reliquique Platonis alumni? <mark>Quorum sine causa fieri nihil putandum est.</mark> Atqui, inquam, Cato, si istud optinueris, traducas me ad te totum licebit. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. </p>\n\n<p>Quo modo autem philosophus loquitur? Omnis enim est natura diligens sui. Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? Vitiosum est enim in dividendo partem in genere numerare. Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Nullus est igitur cuiusquam dies natalis. Quae cum dixisset paulumque institisset, Quid est? Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus. </p>\n\n', 'Quod autem ratione actum est,', ' Lorem ipsum dolor sit amet, consectetur adipiscing elit. Multa sunt dicta ab antiquis de contemnend.', 'publish', 'open', 'open', '', 'quod-autem-ratione-actum-est', '', '', '2020-09-04 14:16:21', '2020-09-04 14:16:21', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/quod-autem-ratione-actum-est/', 0, 'post', '', 0),
