(95, 1, '2020-09-04 14:18:27', '2020-09-04 14:18:27', '<h1>Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit;</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod sequantur, quasi curta sententia; <i>Quae duo sunt, unum facit.</i> Animum autem reliquis rebus ita perfecit, ut corpus; Duo Reges: constructio interrete. <i>Cur deinde Metrodori liberos commendas?</i> Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? </p>\n\n<p>Ea possunt paria non esse. Illa enim, quae prosunt aut quae nocent, aut bona sunt aut mala, quae sint paria necesse est. Idque testamento cavebit is, qui nobis quasi oraculum ediderit nihil post mortem ad nos pertinere? Nescio quo modo praetervolavit oratio. Egone quaeris, inquit, quid sentiam? <b>Sin aliud quid voles, postea.</b> Pisone in eo gymnasio, quod Ptolomaeum vocatur, unaque nobiscum Q. <b>Non igitur bene.</b> </p>\n\n<h3>Illum mallem levares, quo optimum atque humanissimum virum, Cn.</h3>\n\n<p>Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Tubulum fuisse, qua illum, cuius is condemnatus est rogatione, P. <mark>In schola desinis.</mark> <b>Sumenda potius quam expetenda.</b> Ita finis bonorum existit secundum naturam vivere sic affectum, ut optime is affici possit ad naturamque accommodatissime. Claudii libidini, qui tum erat summo ne imperio, dederetur. Nemo nostrum istius generis asotos iucunde putat vivere. Equidem etiam Epicurum, in physicis quidem, Democriteum puto. </p>\n\n<p>Ratio quidem vestra sic cogit. Ergo id est convenienter naturae vivere, a natura discedere. Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. Satis est ad hoc responsum. Suo enim quisque studio maxime ducitur. At enim hic etiam dolore. Sed ad haec, nisi molestum est, habeo quae velim. </p>\n\n<p>Nam ante Aristippus, et ille melius. <b>Contineo me ab exemplis.</b> <b>Quae sequuntur igitur?</b> Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; </p>\n\n<h2>At cum de plurimis eadem dicit, tum certe de maximis.</h2>\n\n<p>Atqui, inquam, Cato, si istud optinueris, traducas me ad te totum licebit. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Sed ille, ut dixi, vitiose. Istam voluptatem, inquit, Epicurus ignorat? Dat enim intervalla et relaxat. Atque his de rebus et splendida est eorum et illustris oratio. </p>\n\n', 'Dolor ergo, id est summum', ', consectetur adipiscing elit. Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod .', 'publish', 'open', 'open', '', 'dolor-ergo-id-est-summum', '', '', '2020-09-04 14:18:27', '2020-09-04 14:18:27', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/dolor-ergo-id-est-summum/', 0, 'post', '', 0),
