(97, 1, '2020-09-04 14:19:20', '2020-09-04 14:19:20', '<h1>Mihi quidem Homerus huius modi quiddam vidisse videatur in iis, quae de Sirenum cantibus finxerit.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Res enim fortasse verae, certe graves, non ita tractantur, ut debent, sed aliquanto minutius. Quid de Platone aut de Democrito loquar? Mihi quidem Homerus huius modi quiddam vidisse videatur in iis, quae de Sirenum cantibus finxerit. Praetereo multos, in bis doctum hominem et suavem, Hieronymum, quem iam cur Peripateticum appellem nescio. Duo Reges: constructio interrete. Unum est sine dolore esse, alterum cum voluptate. Servari enim iustitia nisi a forti viro, nisi a sapiente non potest. Atqui reperies, inquit, in hoc quidem pertinacem; Si quicquam extra virtutem habeatur in bonis. <b>Quae cum dixisset paulumque institisset, Quid est?</b> </p>\n\n<p>Expressa vero in iis aetatibus, quae iam confirmatae sunt. Sed ad bona praeterita redeamus. <i>Ita multa dicunt, quae vix intellegam.</i> Quodsi ipsam honestatem undique pertectam atque absolutam. Nonne igitur tibi videntur, inquit, mala? An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Ut necesse sit omnium rerum, quae natura vigeant, similem esse finem, non eundem. Cur igitur easdem res, inquam, Peripateticis dicentibus verbum nullum est, quod non intellegatur? Illud dico, ea, quae dicat, praeclare inter se cohaerere. Cum audissem Antiochum, Brute, ut solebam, cum M. </p>\n\n<h1>Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt.</h1>\n\n<p>Iam id ipsum absurdum, maximum malum neglegi. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? <b>Atqui reperies, inquit, in hoc quidem pertinacem;</b> <i>Aliter homines, aliter philosophos loqui putas oportere?</i> Qui ita affectus, beatum esse numquam probabis; Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Sed emolumenta communia esse dicuntur, recte autem facta et peccata non habentur communia. Ait enim se, si uratur, Quam hoc suave! dicturum. </p>\n\n<h5>Rationis enim perfectio est virtus;</h5>\n\n<p>Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Videmus igitur ut conquiescere ne infantes quidem possint. Solum praeterea formosum, solum liberum, solum civem, stultost; Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. </p>\n\n<p>Nihilne est in his rebus, quod dignum libero aut indignum esse ducamus? Hoc tu nunc in illo probas. <b>Quorum altera prosunt, nocent altera.</b> Tanti autem aderant vesicae et torminum morbi, ut nihil ad eorum magnitudinem posset accedere. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. <b>Aliter homines, aliter philosophos loqui putas oportere?</b> Tum Triarius: Posthac quidem, inquit, audacius. <mark>Zenonis est, inquam, hoc Stoici.</mark> </p>\n\n<h2>Hic ambiguo ludimur.</h2>\n\n<p>Quid enim possumus hoc agere divinius? Hoc enim constituto in philosophia constituta sunt omnia. His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. An hoc usque quaque, aliter in vita? <b>Sed haec nihil sane ad rem;</b> Tanta vis admonitionis inest in locis; </p>\n\n<h2>Paria sunt igitur.</h2>\n\n<p>Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Nondum autem explanatum satis, erat, quid maxime natura vellet. Eadem nunc mea adversum te oratio est. Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? Cuius quidem, quoniam Stoicus fuit, sententia condemnata mihi videtur esse inanitas ista verborum. <mark>Ita nemo beato beatior.</mark> </p>\n\n<h6>Quae autem natura suae primae institutionis oblita est?</h6>\n\n<p>Nam ante Aristippus, et ille melius. Paulum, cum regem Persem captum adduceret, eodem flumine invectio? A quibus propter discendi cupiditatem videmus ultimas terras esse peragratas. Hoc non est positum in nostra actione. Servari enim iustitia nisi a forti viro, nisi a sapiente non potest. Manebit ergo amicitia tam diu, quam diu sequetur utilitas, et, si utilitas amicitiam constituet, tollet eadem. </p>\n\n<h3>Idem iste, inquam, de voluptate quid sentit?</h3>\n\n<p>Neque solum ea communia, verum etiam paria esse dixerunt. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. </p>\n\n<h4>Ita similis erit ei finis boni, atque antea fuerat, neque idem tamen;</h4>\n\n<p>Hoc sic expositum dissimile est superiori. <mark>Quid, quod res alia tota est?</mark> Satisne vobis videor pro meo iure in vestris auribus commentatus? <b>Occultum facinus esse potuerit, gaudebit;</b> An haec ab eo non dicuntur? Cur id non ita fit? Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. In qua si nihil est praeter rationem, sit in una virtute finis bonorum; </p>\n\n', 'Mihi quidem Homerus huius m', 'Ur in iis, quae de Sirenum cantibus finxerit. Lorem ipsum dolor sit amet, consectetur adipiscing eli.', 'publish', 'open', 'open', '', 'mihi-quidem-homerus-huius-m', '', '', '2020-09-04 14:19:20', '2020-09-04 14:19:20', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/mihi-quidem-homerus-huius-m/', 0, 'post', '', 0),
