(99, 1, '2020-09-04 14:19:42', '2020-09-04 14:19:42', '<h1>Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria?</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Hanc ergo intuens debet institutum illud quasi signum absolvere. Cur iustitia laudatur? Etenim nec iustitia nec amicitia esse omnino poterunt, nisi ipsae per se expetuntur. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Duo Reges: constructio interrete. Quantam rem agas, ut Circeis qui habitet totum hunc mundum suum municipium esse existimet? Quamvis enim depravatae non sint, pravae tamen esse possunt. </p>\n\n<p>Et quidem illud ipsum non nimium probo et tantum patior, philosophum loqui de cupiditatibus finiendis. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Alia quaedam dicent, credo, magna antiquorum esse peccata, quae ille veri investigandi cupidus nullo modo ferre potuerit. Cur haec eadem Democritus? </p>\n\n<p>Ut in geometria, prima si dederis, danda sunt omnia. Nunc dicam de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. <i>Equidem etiam Epicurum, in physicis quidem, Democriteum puto.</i> Quoniam, si dis placet, ab Epicuro loqui discimus. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; </p>\n\n<p>Tantum dico, magis fuisse vestrum agere Epicuri diem natalem, quam illius testamento cavere ut ageretur. Inde sermone vario sex illa a Dipylo stadia confecimus. Quamquam tu hanc copiosiorem etiam soles dicere. Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Tum Quintus: Est plane, Piso, ut dicis, inquit. Illa videamus, quae a te de amicitia dicta sunt. Honesta oratio, Socratica, Platonis etiam. Quoniam, si dis placet, ab Epicuro loqui discimus. </p>\n\n<p>Quae cum magnifice primo dici viderentur, considerata minus probabantur. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Primum cur ista res digna odio est, nisi quod est turpis? Respondent extrema primis, media utrisque, omnia omnibus. Illa argumenta propria videamus, cur omnia sint paria peccata. Cuius similitudine perspecta in formarum specie ac dignitate transitum est ad honestatem dictorum atque factorum. Quod non faceret, si in voluptate summum bonum poneret. Atque ab his initiis profecti omnium virtutum et originem et progressionem persecuti sunt. </p>\n\n<p>Iam id ipsum absurdum, maximum malum neglegi. Nisi autem rerum natura perspecta erit, nullo modo poterimus sensuum iudicia defendere. Qua tu etiam inprudens utebare non numquam. Sunt enim prima elementa naturae, quibus auctis vrtutis quasi germen efficitur. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Quia, si mala sunt, is, qui erit in iis, beatus non erit. Sed quid attinet de rebus tam apertis plura requirere? Nec vero pietas adversus deos nec quanta iis gratia debeatur sine explicatione naturae intellegi potest. </p>\n\n<p><i>Quam ob rem tandem, inquit, non satisfacit?</i> Oratio me istius philosophi non offendit; Curium putes loqui, interdum ita laudat, ut quid praeterea sit bonum neget se posse ne suspicari quidem. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Quid igitur, inquit, eos responsuros putas? Haec mihi videtur delicatior, ut ita dicam, molliorque ratio, quam virtutis vis gravitasque postulat. </p>\n\n<p>Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Non pugnem cum homine, cur tantum habeat in natura boni; <mark>Prioris generis est docilitas, memoria;</mark> Nam bonum ex quo appellatum sit, nescio, praepositum ex eo credo, quod praeponatur aliis. Quod non faceret, si in voluptate summum bonum poneret. Non dolere, inquam, istud quam vim habeat postea videro; Etenim nec iustitia nec amicitia esse omnino poterunt, nisi ipsae per se expetuntur. Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? </p>\n\n<p>Ita redarguitur ipse a sese, convincunturque scripta eius probitate ipsius ac moribus. Universa enim illorum ratione cum tota vestra confligendum puto. Quonam, inquit, modo? Sic vester sapiens magno aliquo emolumento commotus cicuta, si opus erit, dimicabit. Urgent tamen et nihil remittunt. <b>Haec para/doca illi, nos admirabilia dicamus.</b> <b>Idem iste, inquam, de voluptate quid sentit?</b> </p>\n\n<h2>Quae in controversiam veniunt, de iis, si placet, disseramus.</h2>\n\n<p>Isto modo ne improbos quidem, si essent boni viri. Philosophi autem in suis lectulis plerumque moriuntur. Num igitur eum postea censes anxio animo aut sollicito fuisse? Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Tum ille: Tu autem cum ipse tantum librorum habeas, quos hic tandem requiris? Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. At Zeno eum non beatum modo, sed etiam divitem dicere ausus est. Ex quo illud efficitur, qui bene cenent omnis libenter cenare, qui libenter, non continuo bene. </p>\n\n', 'Num igitur utiliorem tibi hunc Tria', '? Lorem ipsum dolor sit amet, consectetur adipiscing elit. Audax negotium, dicerem impudens, nisi ho.', 'publish', 'open', 'open', '', 'num-igitur-utiliorem-tibi-hunc-tria', '', '', '2020-09-04 14:19:42', '2020-09-04 14:19:42', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/num-igitur-utiliorem-tibi-hunc-tria/', 0, 'post', '', 0),
