(101, 1, '2020-09-04 14:19:59', '2020-09-04 14:19:59', '<h1>Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. An est aliquid, quod te sua sponte delectet? Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Duo Reges: constructio interrete. <mark>Quare attende, quaeso.</mark> <i>Et nemo nimium beatus est;</i> Hoc enim identidem dicitis, non intellegere nos quam dicatis voluptatem. Quod cum dixissent, ille contra. <b>Quod quidem nobis non saepe contingit.</b> Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. </p>\n\n<p><b>Quam ob rem tandem, inquit, non satisfacit?</b> Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Sed quanta sit alias, nunc tantum possitne esse tanta. Qua tu etiam inprudens utebare non numquam. Quare attende, quaeso. Nemo nostrum istius generis asotos iucunde putat vivere. Quod, inquit, quamquam voluptatibus quibusdam est saepe iucundius, tamen expetitur propter voluptatem. </p>\n\n<p>Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Ergo et avarus erit, sed finite, et adulter, verum habebit modum, et luxuriosus eodem modo. Hoc est non dividere, sed frangere. An hoc usque quaque, aliter in vita? De vacuitate doloris eadem sententia erit. </p>\n\n<p>Portenta haec esse dicit, neque ea ratione ullo modo posse vivi; Itaque contra est, ac dicitis; Sequitur disserendi ratio cognitioque naturae; Omnium enim rerum principia parva sunt, sed suis progressionibus usa augentur nec sine causa; <b>At enim hic etiam dolore.</b> Satisne ergo pudori consulat, si quis sine teste libidini pareat? </p>\n\n<p>Quando enim Socrates, qui parens philosophiae iure dici potest, quicquam tale fecit? Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Quid ergo? Quia, si mala sunt, is, qui erit in iis, beatus non erit. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Hoc est dicere: Non reprehenderem asotos, si non essent asoti. </p>\n\n<p>Idemne, quod iucunde? Isto modo ne improbos quidem, si essent boni viri. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Nam bonum ex quo appellatum sit, nescio, praepositum ex eo credo, quod praeponatur aliis. <i>Sin aliud quid voles, postea.</i> Hoc ille tuus non vult omnibusque ex rebus voluptatem quasi mercedem exigit. </p>\n\n<p><b>Rationis enim perfectio est virtus;</b> Cur iustitia laudatur? An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Sit hoc ultimum bonorum, quod nunc a me defenditur; Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. Non enim iam stirpis bonum quaeret, sed animalis. </p>\n\n<p>Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. <i>Age, inquies, ista parva sunt.</i> <b>Quonam, inquit, modo?</b> <i>Respondeat totidem verbis.</i> </p>\n\n<h2>Satis est ad hoc responsum.</h2>\n\n<p><mark>Praeclare hoc quidem.</mark> Quod est, ut dixi, habere ea, quae secundum naturam sint, vel omnia vel plurima et maxima. Eam tum adesse, cum dolor omnis absit; Nemo nostrum istius generis asotos iucunde putat vivere. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Expectoque quid ad id, quod quaerebam, respondeas. </p>\n\n<p><b>Quae est igitur causa istarum angustiarum?</b> <mark>Sin laboramus, quis est, qui alienae modum statuat industriae?</mark> Sic enim censent, oportunitatis esse beate vivere. Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire sapienti. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Nam ista vestra: Si gravis, brevis; Sed quod proximum fuit non vidit. Cur haec eadem Democritus? Tum Lucius: Mihi vero ista valde probata sunt, quod item fratri puto. </p>\n\n', 'Nam aliquando posse recte fieri', 'Or sit amet, consectetur adipiscing elit. An est aliquid, quod te sua sponte delectet? Tum Piso: Quo.', 'publish', 'open', 'open', '', 'nam-aliquando-posse-recte-fieri', '', '', '2020-09-04 14:19:59', '2020-09-04 14:19:59', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/nam-aliquando-posse-recte-fieri/', 0, 'post', '', 0),
