(107, 1, '2020-09-04 14:20:38', '2020-09-04 14:20:38', '<h1>Invidiosum nomen est, infame, suspectum.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quis est, qui non oderit libidinosam, protervam adolescentiam? Videsne igitur Zenonem tuum cum Aristone verbis concinere, re dissidere, cum Aristotele et illis re consentire, verbis discrepare? Isto modo ne improbos quidem, si essent boni viri. Et nunc quidem quod eam tuetur, ut de vite potissimum loquar, est id extrinsecus; Duo Reges: constructio interrete. Nam ista vestra: Si gravis, brevis; Tollenda est atque extrahenda radicitus. </p>\n\n<p>Quod quidem iam fit etiam in Academia. Cuius similitudine perspecta in formarum specie ac dignitate transitum est ad honestatem dictorum atque factorum. Quamquam id quidem, infinitum est in hac urbe; Quae quo sunt excelsiores, eo dant clariora indicia naturae. At enim, qua in vita est aliquid mali, ea beata esse non potest. Miserum hominem! Si dolor summum malum est, dici aliter non potest. </p>\n\n<h2>Quod cum dixissent, ille contra.</h2>\n\n<p>Haec para/doca illi, nos admirabilia dicamus. Prodest, inquit, mihi eo esse animo. Ergo in gubernando nihil, in officio plurimum interest, quo in genere peccetur. Quoniam, si dis placet, ab Epicuro loqui discimus. Mihi enim satis est, ipsis non satis. Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? </p>\n\n<p>Cupit enim dcere nihil posse ad beatam vitam deesse sapienti. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Quid loquor de nobis, qui ad laudem et ad decus nati, suscepti, instituti sumus? Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Mihi enim erit isdem istis fortasse iam utendum. <b>Zenonis est, inquam, hoc Stoici.</b> Piso, familiaris noster, et alia multa et hoc loco Stoicos irridebat: Quid enim? </p>\n\n<p><i>Venit ad extremum;</i> Cur id non ita fit? Re mihi non aeque satisfacit, et quidem locis pluribus. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Illis videtur, qui illud non dubitant bonum dicere -; </p>\n\n<p>Itaque contra est, ac dicitis; Sed ad rem redeamus; <i>Nos commodius agimus.</i> Nihil opus est exemplis hoc facere longius. Cur fortior sit, si illud, quod tute concedis, asperum et vix ferendum putabit? Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Ut in geometria, prima si dederis, danda sunt omnia. </p>\n\n<p><b>Nihil opus est exemplis hoc facere longius.</b> Indicant pueri, in quibus ut in speculis natura cernitur. Quod autem ratione actum est, id officium appellamus. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. </p>\n\n<p>Quae quidem vel cum periculo est quaerenda vobis; At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Quae in controversiam veniunt, de iis, si placet, disseramus. Quod non faceret, si in voluptate summum bonum poneret. Sed nonne merninisti licere mihi ista probare, quae sunt a te dicta? Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Comprehensum, quod cognitum non habet? <b>Cui Tubuli nomen odio non est?</b> Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Vulgo enim dicitur: Iucundi acti labores, nec male Euripidesconcludam, si potero, Latine; </p>\n\n<p><b>At iam decimum annum in spelunca iacet.</b> Sunt enim prima elementa naturae, quibus auctis vrtutis quasi germen efficitur. Quo plebiscito decreta a senatu est consuli quaestio Cn. Nondum autem explanatum satis, erat, quid maxime natura vellet. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. A quibus propter discendi cupiditatem videmus ultimas terras esse peragratas. </p>\n\n<h3>Cur iustitia laudatur?</h3>\n\n<p>Bestiarum vero nullum iudicium puto. Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. Sed hoc sane concedamus. At iam decimum annum in spelunca iacet. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Beatus autem esse in maximarum rerum timore nemo potest. In motu et in statu corporis nihil inest, quod animadvertendum esse ipsa natura iudicet? Venit ad extremum; Nam bonum ex quo appellatum sit, nescio, praepositum ex eo credo, quod praeponatur aliis. Primum in nostrane potestate est, quid meminerimus? </p>\n\n', 'Invidiosum nomen est, infame,', 'Iscing elit. Quis est, qui non oderit libidinosam, protervam adolescentiam? Videsne igitur Zenonem t.', 'publish', 'open', 'open', '', 'invidiosum-nomen-est-infame', '', '', '2020-09-04 14:20:38', '2020-09-04 14:20:38', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/invidiosum-nomen-est-infame/', 0, 'post', '', 0),
