(109, 1, '2020-09-04 14:20:55', '2020-09-04 14:20:55', '<h1>Hoc Hieronymus summum bonum esse dixit.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quae diligentissime contra Aristonem dicuntur a Chryippo. Quid de Platone aut de Democrito loquar? Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Duo Reges: constructio interrete. Ex rebus enim timiditas, non ex vocabulis nascitur. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. </p>\n\n<h4>Quid enim ab antiquis ex eo genere, quod ad disserendum valet, praetermissum est?</h4>\n\n<p>Vitiosum est enim in dividendo partem in genere numerare. <b>Quid sequatur, quid repugnet, vident.</b> Partim cursu et peragratione laetantur, congregatione aliae coetum quodam modo civitatis imitantur; Quamquam haec quidem praeposita recte et reiecta dicere licebit. Verba tu fingas et ea dicas, quae non sentias? Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Quibus rebus vita consentiens virtutibusque respondens recta et honesta et constans et naturae congruens existimari potest. Sapientem locupletat ipsa natura, cuius divitias Epicurus parabiles esse docuit. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Quae in controversiam veniunt, de iis, si placet, disseramus. </p>\n\n<h2>Ita similis erit ei finis boni, atque antea fuerat, neque idem tamen;</h2>\n\n<p>Illa argumenta propria videamus, cur omnia sint paria peccata. Collige omnia, quae soletis: Praesidium amicorum. Quid enim est a Chrysippo praetermissum in Stoicis? Immo istud quidem, inquam, quo loco quidque, nisi iniquum postulo, arbitratu meo. Quid dubitas igitur mutare principia naturae? Torquatus, is qui consul cum Cn. Ita nemo beato beatior. </p>\n\n<h3>Quid est, quod ab ea absolvi et perfici debeat?</h3>\n\n<p>Re mihi non aeque satisfacit, et quidem locis pluribus. Quod est, ut dixi, habere ea, quae secundum naturam sint, vel omnia vel plurima et maxima. Ne discipulum abducam, times. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Bonum negas esse divitias, praepostum esse dicis? <b>Ratio quidem vestra sic cogit.</b> </p>\n\n<p><mark>Qui non moveatur et offensione turpitudinis et comprobatione honestatis?</mark> Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. Nam, ut paulo ante docui, augendae voluptatis finis est doloris omnis amotio. Traditur, inquit, ab Epicuro ratio neglegendi doloris. <b>Quid de Pythagora?</b> Fortitudinis quaedam praecepta sunt ac paene leges, quae effeminari virum vetant in dolore. Videsne, ut haec concinant? Si de re disceptari oportet, nulla mihi tecum, Cato, potest esse dissensio. Quicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? </p>\n\n<p>Est enim effectrix multarum et magnarum voluptatum. Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate est. Nam, ut paulo ante docui, augendae voluptatis finis est doloris omnis amotio. Quae autem natura suae primae institutionis oblita est? Restatis igitur vos; Quis est tam dissimile homini. Tu enim ista lenius, hic Stoicorum more nos vexat. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? <b>Age, inquies, ista parva sunt.</b> <b>Praeclare hoc quidem.</b> Sed audiamus ipsum: Compensabatur, inquit, tamen cum his omnibus animi laetitia, quam capiebam memoria rationum inventorumque nostrorum. Qui est in parvis malis. </p>\n\n<p><i>Quod ea non occurrentia fingunt, vincunt Aristonem;</i> Vives, inquit Aristo, magnifice atque praeclare, quod erit cumque visum ages, numquam angere, numquam cupies, numquam timebis. Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. <b>Quid ad utilitatem tantae pecuniae?</b> Si enim ita est, vide ne facinus facias, cum mori suadeas. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. <b>Haec dicuntur inconstantissime.</b> Sed tempus est, si videtur, et recta quidem ad me. Iam doloris medicamenta illa Epicurea tamquam de narthecio proment: Si gravis, brevis; </p>\n\n<p>Neque solum ea communia, verum etiam paria esse dixerunt. Num igitur eum postea censes anxio animo aut sollicito fuisse? Iam enim adesse poterit. <b>Ea possunt paria non esse.</b> <b>Quid iudicant sensus?</b> Tantum dico, magis fuisse vestrum agere Epicuri diem natalem, quam illius testamento cavere ut ageretur. Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Qui enim voluptatem ipsam contemnunt, iis licet dicere se acupenserem maenae non anteponere. Certe non potest. <b>Nullus est igitur cuiusquam dies natalis.</b> Mihi enim satis est, ipsis non satis. </p>\n\n<p>Etenim si delectamur, cum scribimus, quis est tam invidus, qui ab eo nos abducat? Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Quamquam tu hanc copiosiorem etiam soles dicere. <b>Sint ista Graecorum;</b> <i>An vero, inquit, quisquam potest probare, quod perceptfum, quod.</i> Cyrenaici quidem non recusant; Negat esse eam, inquit, propter se expetendam. </p>\n\n<p>Nondum autem explanatum satis, erat, quid maxime natura vellet. <i>Haec quo modo conveniant, non sane intellego.</i> Nosti, credo, illud: Nemo pius est, qui pietatem-; </p>\n\n', 'Hoc Hieronymus summum bonum ess', ' dolor sit amet, consectetur adipiscing elit. Quae diligentissime contra Aristonem dicuntur a Chryip.', 'publish', 'open', 'open', '', 'hoc-hieronymus-summum-bonum-ess', '', '', '2020-09-04 14:20:55', '2020-09-04 14:20:55', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/hoc-hieronymus-summum-bonum-ess/', 0, 'post', '', 0),
