(111, 1, '2020-09-04 14:21:16', '2020-09-04 14:21:16', '<h1>Si longus, levis.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vitiosum est enim in dividendo partem in genere numerare. Quid enim possumus hoc agere divinius? Graccho, eius fere, aequal? Hoc enim constituto in philosophia constituta sunt omnia. Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Aliter enim explicari, quod quaeritur, non potest. </p>\n\n<p>Age nunc isti doceant, vel tu potius quis enim ista melius? Dicimus aliquem hilare vivere; Hoc ipsum elegantius poni meliusque potuit. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? </p>\n\n<p>Ille enim occurrentia nescio quae comminiscebatur; Nec vero pietas adversus deos nec quanta iis gratia debeatur sine explicatione naturae intellegi potest. <i>Bonum patria: miserum exilium.</i> Paria sunt igitur. Ergo, si semel tristior effectus est, hilara vita amissa est? Nihil ad rem! Ne sit sane; </p>\n\n<p>Duo Reges: constructio interrete. <b>Satis est ad hoc responsum.</b> In quo etsi est magnus, tamen nova pleraque et perpauca de moribus. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Quis contra in illa aetate pudorem, constantiam, etiamsi sua nihil intersit, non tamen diligat? Illud mihi a te nimium festinanter dictum videtur, sapientis omnis esse semper beatos; Non enim solum Torquatus dixit quid sentiret, sed etiam cur. </p>\n\n<h4>Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt;</h4>\n\n<p>Saepe ab Aristotele, a Theophrasto mirabiliter est laudata per se ipsa rerum scientia; Eam tum adesse, cum dolor omnis absit; Quod autem ratione actum est, id officium appellamus. <i>Estne, quaeso, inquam, sitienti in bibendo voluptas?</i> Eadem nunc mea adversum te oratio est. Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. </p>\n\n<p>At iam decimum annum in spelunca iacet. <i>Poterat autem inpune;</i> Nobis aliter videtur, recte secusne, postea; Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Quis Pullum Numitorium Fregellanum, proditorem, quamquam rei publicae nostrae profuit, non odit? His enim rebus detractis negat se reperire in asotorum vita quod reprehendat. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Istam voluptatem, inquit, Epicurus ignorat? Hoc enim identidem dicitis, non intellegere nos quam dicatis voluptatem. </p>\n\n<h2>Aeque enim contingit omnibus fidibus, ut incontentae sint.</h2>\n\n<p>Iam quae corporis sunt, ea nec auctoritatem cum animi partibus, comparandam et cognitionem habent faciliorem. Paria sunt igitur. Superiores tres erant, quae esse possent, quarum est una sola defensa, eaque vehementer. Hoc tu nunc in illo probas. <i>Sed mehercule pergrata mihi oratio tua.</i> Tecum optime, deinde etiam cum mediocri amico. Quantum Aristoxeni ingenium consumptum videmus in musicis? Eam tum adesse, cum dolor omnis absit; Claudii libidini, qui tum erat summo ne imperio, dederetur. Ita prorsus, inquam; </p>\n\n<p>Quod ea non occurrentia fingunt, vincunt Aristonem; Eodem modo is enim tibi nemo dabit, quod, expetendum sit, id esse laudabile. <b>Quae cum dixisset, finem ille.</b> Sed ego in hoc resisto; Venit ad extremum; Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Qui enim existimabit posse se miserum esse beatus non erit. <b>At coluit ipse amicitias.</b> Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Est enim effectrix multarum et magnarum voluptatum. </p>\n\n<h3>Idem iste, inquam, de voluptate quid sentit?</h3>\n\n<p>Quae in controversiam veniunt, de iis, si placet, disseramus. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? At Zeno eum non beatum modo, sed etiam divitem dicere ausus est. Sed haec nihil sane ad rem; </p>\n\n<p>Semper enim ita adsumit aliquid, ut ea, quae prima dederit, non deserat. Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Est autem officium, quod ita factum est, ut eius facti probabilis ratio reddi possit. Egone non intellego, quid sit don Graece, Latine voluptas? Hoc enim constituto in philosophia constituta sunt omnia. Innumerabilia dici possunt in hanc sententiam, sed non necesse est. </p>\n\n', 'Si longus, levis. Lorem ipsum dol', 'T. Vitiosum est enim in dividendo partem in genere numerare. Quid enim possumus hoc agere divinius? .', 'publish', 'open', 'open', '', 'si-longus-levis-lorem-ipsum-dol', '', '', '2020-09-04 14:21:16', '2020-09-04 14:21:16', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/si-longus-levis-lorem-ipsum-dol/', 0, 'post', '', 0),
