(113, 1, '2020-09-04 14:21:22', '2020-09-04 14:21:22', '<h1>Vitae autem degendae ratio maxime quidem illis placuit quieta.</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire sapienti. Sed ad bona praeterita redeamus. Tenesne igitur, inquam, Hieronymus Rhodius quid dicat esse summum bonum, quo putet omnia referri oportere? Pisone in eo gymnasio, quod Ptolomaeum vocatur, unaque nobiscum Q. Quid, de quo nulla dissensio est? Duo Reges: constructio interrete. </p>\n\n<p>Sic enim censent, oportunitatis esse beate vivere. Bonum negas esse divitias, praepostum esse dicis? Cur igitur, cum de re conveniat, non malumus usitate loqui? Nec enim, dum metuit, iustus est, et certe, si metuere destiterit, non erit; Aliena dixit in physicis nec ea ipsa, quae tibi probarentur; Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Huius ego nunc auctoritatem sequens idem faciam. <i>Verum hoc idem saepe faciamus.</i> </p>\n\n<p>Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Nam si beatus umquam fuisset, beatam vitam usque ad illum a Cyro extructum rogum pertulisset. Quod ea non occurrentia fingunt, vincunt Aristonem; <b>Tamen a proposito, inquam, aberramus.</b> Laboro autem non sine causa; Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. </p>\n\n<p>Quamvis enim depravatae non sint, pravae tamen esse possunt. Habent enim et bene longam et satis litigiosam disputationem. Quod ea non occurrentia fingunt, vincunt Aristonem; Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Maximus dolor, inquit, brevis est. Nihil opus est exemplis hoc facere longius. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. </p>\n\n<p>Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. <b>Tum Torquatus: Prorsus, inquit, assentior;</b> Et certamen honestum et disputatio splendida! omnis est enim de virtutis dignitate contentio. Tum ille timide vel potius verecunde: Facio, inquit. Comprehensum, quod cognitum non habet? His singulis copiose responderi solet, sed quae perspicua sunt longa esse non debent. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. <i>Prioris generis est docilitas, memoria;</i> </p>\n\n<h3>An vero, inquit, quisquam potest probare, quod perceptfum, quod.</h3>\n\n<p>Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Quaerimus enim finem bonorum. <b>Sed residamus, inquit, si placet.</b> Qua tu etiam inprudens utebare non numquam. <b>Omnia contraria, quos etiam insanos esse vultis.</b> <mark>Primum quid tu dicis breve?</mark> Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Expressa vero in iis aetatibus, quae iam confirmatae sunt. </p>\n\n<p>Cur post Tarentum ad Archytam? Ergo, si semel tristior effectus est, hilara vita amissa est? <i>At iam decimum annum in spelunca iacet.</i> Tanti autem aderant vesicae et torminum morbi, ut nihil ad eorum magnitudinem posset accedere. </p>\n\n<h2>Non quam nostram quidem, inquit Pomponius iocans;</h2>\n\n<p>Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. A mene tu? Indicant pueri, in quibus ut in speculis natura cernitur. Legimus tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. Conferam tecum, quam cuique verso rem subicias; Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Hoc enim constituto in philosophia constituta sunt omnia. </p>\n\n<p>Quis enim confidit semper sibi illud stabile et firmum permansurum, quod fragile et caducum sit? At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. <b>Torquatus, is qui consul cum Cn.</b> <i>Haec et tu ita posuisti, et verba vestra sunt.</i> Aliena dixit in physicis nec ea ipsa, quae tibi probarentur; <mark>Nihilo beatiorem esse Metellum quam Regulum.</mark> Omnes enim iucundum motum, quo sensus hilaretur. Sed vos squalidius, illorum vides quam niteat oratio. Sin ea non neglegemus neque tamen ad finem summi boni referemus, non multum ab Erilli levitate aberrabimus. </p>\n\n<p>Sin autem ad animum, falsum est, quod negas animi ullum esse gaudium, quod non referatur ad corpus. Laboro autem non sine causa; Sed nimis multa. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; <b>Quae similitudo in genere etiam humano apparet.</b> Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. </p>\n\n', 'Vitae autem degendae ratio', 'Sectetur adipiscing elit. Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire.', 'publish', 'open', 'open', '', 'vitae-autem-degendae-ratio', '', '', '2020-09-04 14:21:22', '2020-09-04 14:21:22', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/vitae-autem-degendae-ratio/', 0, 'post', '', 0),
