(115, 1, '2020-09-04 14:21:40', '2020-09-04 14:21:40', '<h1>Mihi, inquam, qui te id ipsum rogavi?</h1>\n\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. <i>Non quam nostram quidem, inquit Pomponius iocans;</i> Si verbum sequimur, primum longius verbum praepositum quam bonum. Haec quo modo conveniant, non sane intellego. <b>Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio?</b> An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? <mark>Duo Reges: constructio interrete.</mark> Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Etiam beatissimum? Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. Nondum autem explanatum satis, erat, quid maxime natura vellet. </p>\n\n<h6>An ea, quae per vinitorem antea consequebatur, per se ipsa curabit?</h6>\n\n<p><b>Aperiendum est igitur, quid sit voluptas;</b> <b>Immo videri fortasse.</b> <b>Huius, Lyco, oratione locuples, rebus ipsis ielunior.</b> Igitur neque stultorum quisquam beatus neque sapientium non beatus. <b>Age sane, inquam.</b> </p>\n\n<h5>Est, ut dicis, inquam.</h5>\n\n<p><b>Non laboro, inquit, de nomine.</b> <b>Ego vero isti, inquam, permitto.</b> </p>\n\n<p>Nobis Heracleotes ille Dionysius flagitiose descivisse videtur a Stoicis propter oculorum dolorem. Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. Sed tu istuc dixti bene Latine, parum plane. Quam ob rem tandem, inquit, non satisfacit? Pudebit te, inquam, illius tabulae, quam Cleanthes sane commode verbis depingere solebat. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Aliis esse maiora, illud dubium, ad id, quod summum bonum dicitis, ecquaenam possit fieri accessio. Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Sed non alienum est, quo facilius vis verbi intellegatur, rationem huius verbi faciendi Zenonis exponere. Quam ob rem tandem, inquit, non satisfacit? </p>\n\n<h3>Nihil minus, contraque illa hereditate dives ob eamque rem laetus.</h3>\n\n<p>Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Primum cur ista res digna odio est, nisi quod est turpis? Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Aliter enim nosmet ipsos nosse non possumus. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. </p>\n\n<p><b>Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus;</b> Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. <mark>Conferam tecum, quam cuique verso rem subicias;</mark> </p>\n\n<h1>Itaque hoc frequenter dici solet a vobis, non intellegere nos, quam dicat Epicurus voluptatem.</h1>\n\n<p><i>Tum ille timide vel potius verecunde: Facio, inquit.</i> Utrum igitur tibi litteram videor an totas paginas commovere? Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; <i>Quam si explicavisset, non tam haesitaret.</i> <b>Si longus, levis;</b> Multoque hoc melius nos veriusque quam Stoici. Sin laboramus, quis est, qui alienae modum statuat industriae? Hanc quoque iucunditatem, si vis, transfer in animum; </p>\n\n<h2>Comprehensum, quod cognitum non habet?</h2>\n\n<p><i>Et nemo nimium beatus est;</i> Idem adhuc; <mark>Sed tu istuc dixti bene Latine, parum plane.</mark> Suo enim quisque studio maxime ducitur. Qualem igitur hominem natura inchoavit? Si enim ad populum me vocas, eum. <i>Proclivi currit oratio.</i> Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. </p>\n\n<h2>Dici enim nihil potest verius.</h2>\n\n<p>Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Non quam nostram quidem, inquit Pomponius iocans; <mark>Tecum optime, deinde etiam cum mediocri amico.</mark> Istam voluptatem perpetuam quis potest praestare sapienti? </p>\n\n<h4>Quodsi ipsam honestatem undique pertectam atque absolutam.</h4>\n\n<p>Zenonis est, inquam, hoc Stoici. Cur iustitia laudatur? Cave putes quicquam esse verius. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Non enim quaero quid verum, sed quid cuique dicendum sit. Si quicquam extra virtutem habeatur in bonis. Vestri haec verecundius, illi fortasse constantius. Positum est a nostris in iis esse rebus, quae secundum naturam essent, non dolere; Invidiosum nomen est, infame, suspectum. Quantum Aristoxeni ingenium consumptum videmus in musicis? </p>\n\n', 'Mihi, inquam, qui te id ipsum ro', 'Dipiscing elit. Non quam nostram quidem, inquit Pomponius iocans; Si verbum sequimur, primum longius.', 'publish', 'open', 'open', '', 'mihi-inquam-qui-te-id-ipsum-ro', '', '', '2020-09-04 14:21:40', '2020-09-04 14:21:40', '', 0, 'http://localhost/pizzahtmltowordpress/2020/09/04/mihi-inquam-qui-te-id-ipsum-ro/', 0, 'post', '', 0),
